export const toc = [{
  value: 'PairCreated',
  id: 'paircreated',
  children: []
}, {
  value: 'getPair',
  id: 'getpair',
  children: []
}, {
  value: 'allPairs',
  id: 'allpairs',
  children: []
}, {
  value: 'allPairsLength',
  id: 'allpairslength',
  children: []
}, {
  value: 'feeTo',
