  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
      console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
      return <div {...props}/>
    };
const Link = makeShortcode("Link");
const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "code"
    }}>{`Code`}</h1>
    <p><a parentName="p" {...{
        "href": "https://github.com/Uniswap/uniswap-v2-core/blob/master/contracts/UniswapV2Factory.sol"
      }}><inlineCode parentName="a">{`UniswapV2Factory.sol`}</inlineCode></a></p>
    <h1 {...{
      "id": "address"
    }}>{`Address`}</h1>
    <p><inlineCode parentName="p">{`UniswapV2Factory`}</inlineCode>{` is deployed at `}<inlineCode parentName="p">{`0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f`}</inlineCode>{` on the Ethereum `}<a parentName="p" {...{
        "href": "https://etherscan.io/address/0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f"
      }}>{`mainnet`}</a>{`, and the `}<a parentName="p" {...{
        "href": "https://ropsten.etherscan.io/address/0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f"
      }}>{`Ropsten`}</a>{`, `}<a parentName="p" {...{
        "href": "https://rinkeby.etherscan.io/address/0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f"
      }}>{`Rinkeby`}</a>{`, `}<a parentName="p" {...{
        "href": "https://goerli.etherscan.io/address/0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f"
      }}>{`GÃ¶rli`}</a>{`, and `}<a parentName="p" {...{
        "href": "https://kovan.etherscan.io/address/0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f"
      }}>{`Kovan`}</a>{` testnets. It was built from commit `}<a parentName="p" {...{
        "href": "https://github.com/Uniswap/uniswap-v2-core/tree/816075049f811f1b061bca81d5d040b96f4c07eb"
      }}>{`8160750`}</a>{`.`}</p>
    <h1 {...{
      "id": "events"
    }}>{`Events`}</h1>
    <h2 {...{
      "id": "paircreated"
    }}>{`PairCreated`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-solidity"
      }}>{`event PairCreated(address indexed token0, address indexed token1, address pair, uint);
`}</code></pre>
    <p>{`Emitted each time a pair is created via `}<a parentName="p" {...{
        "href": "#createpair"
      }}>{`createPair`}</a>{`.`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`token0`}</inlineCode>{` is guaranteed to be strictly less than `}<inlineCode parentName="li">{`token1`}</inlineCode>{` by sort order.`}</li>
      <li parentName="ul">{`The final `}<inlineCode parentName="li">{`uint`}</inlineCode>{` log value will be `}<inlineCode parentName="li">{`1`}</inlineCode>{` for the first pair created, `}<inlineCode parentName="li">{`2`}</inlineCode>{` for the second, etc. (see `}<a parentName="li" {...{
          "href": "#allpairs"
        }}>{`allPairs`}</a>{`/`}<a parentName="li" {...{
          "href": "#getpair"
        }}>{`getPair`}</a>{`).`}</li>
    </ul>
    <h1 {...{
      "id": "read-only-functions"
    }}>{`Read-Only Functions`}</h1>
    <h2 {...{
      "id": "getpair"
    }}>{`getPair`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-solidity"
      }}>{`function getPair(address tokenA, address tokenB) external view returns (address pair);
`}</code></pre>
    <p>{`Returns the address of the pair for `}<inlineCode parentName="p">{`tokenA`}</inlineCode>{` and `}<inlineCode parentName="p">{`tokenB`}</inlineCode>{`, if it has been created, else `}<inlineCode parentName="p">{`address(0)`}</inlineCode>{` (`}<inlineCode parentName="p">{`0x0000000000000000000000000000000000000000`}</inlineCode>{`).`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`tokenA`}</inlineCode>{` and `}<inlineCode parentName="li">{`tokenB`}</inlineCode>{` are interchangeable.`}</li>
      <li parentName="ul">{`Pair addresses can also be calculated deterministically, see `}<Link to='/docs/v2/javascript-SDK/getting-pair-addresses/' mdxType="Link">{`Pair Addresses`}</Link>{`.`}</li>
    </ul>
    <h2 {...{
      "id": "allpairs"
    }}>{`allPairs`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-solidity"
      }}>{`function allPairs(uint) external view returns (address pair);
`}</code></pre>
    <p>{`Returns the address of the `}<inlineCode parentName="p">{`n`}</inlineCode>{`th pair (`}<inlineCode parentName="p">{`0`}</inlineCode>{`-indexed) created through the factory, or `}<inlineCode parentName="p">{`address(0)`}</inlineCode>{` (`}<inlineCode parentName="p">{`0x0000000000000000000000000000000000000000`}</inlineCode>{`) if not enough pairs have been created yet.`}</p>
    <ul>
      <li parentName="ul">{`Pass `}<inlineCode parentName="li">{`0`}</inlineCode>{` for the address of the first pair created, `}<inlineCode parentName="li">{`1`}</inlineCode>{` for the second, etc.`}</li>
    </ul>
    <h2 {...{
      "id": "allpairslength"
    }}>{`allPairsLength`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-solidity"
      }}>{`function allPairsLength() external view returns (uint);
`}</code></pre>
    <p>{`Returns the total number of pairs created through the factory so far.`}</p>
    <h2 {...{
      "id": "feeto"
    }}>{`feeTo`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-solidity"
      }}>{`function feeTo() external view returns (address);
`}</code></pre>
    <p>{`See `}<Link to='/docs/v2/advanced-topics/fees/#protocol-charge-calculation' mdxType="Link">{`Protocol Charge Calculation`}</Link>{`.`}</p>
    <h2 {...{
      "id": "feetosetter"
    }}>{`feeToSetter`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-solidity"
      }}>{`function feeToSetter() external view returns (address);
`}</code></pre>
    <p>{`The address allowed to change `}<a parentName="p" {...{
        "href": "#feeto"
      }}>{`feeTo`}</a>{`.`}</p>
    <h1 {...{
      "id": "state-changing-functions"
    }}>{`State-Changing Functions`}</h1>
    <h2 {...{
      "id": "createpair"
    }}>{`createPair`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-solidity"
      }}>{`function createPair(address tokenA, address tokenB) external returns (address pair);
`}</code></pre>
    <p>{`Creates a pair for `}<inlineCode parentName="p">{`tokenA`}</inlineCode>{` and `}<inlineCode parentName="p">{`tokenB`}</inlineCode>{` if one doesn't exist already.`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`tokenA`}</inlineCode>{` and `}<inlineCode parentName="li">{`tokenB`}</inlineCode>{` are interchangeable.`}</li>
      <li parentName="ul">{`Emits `}<a parentName="li" {...{
          "href": "#paircreated"
        }}>{`PairCreated`}</a>{`.`}</li>
    </ul>
    <h1 {...{
      "id": "interface"
    }}>{`Interface`}</h1>
    <pre><code parentName="pre" {...{
        "className": "language-solidity"
      }}>{`import '@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol';
`}</code></pre>
    <pre><code parentName="pre" {...{
        "className": "language-solidity"
      }}>{`pragma solidity >=0.5.0;

interface IUniswapV2Factory {
  event PairCreated(address indexed token0, address indexed token1, address pair, uint);

  function getPair(address tokenA, address tokenB) external view returns (address pair);
  function allPairs(uint) external view returns (address pair);
  function allPairsLength() external view returns (uint);

  function feeTo() external view returns (address);
  function feeToSetter() external view returns (address);

  function createPair(address tokenA, address tokenB) external returns (address pair);
}
`}</code></pre>
    <h1 {...{
      "id": "abi"
    }}>{`ABI`}</h1>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`import IUniswapV2Factory from '@uniswap/v2-core/build/IUniswapV2Factory.json'
`}</code></pre>
    <p><a parentName="p" {...{
        "href": "https://unpkg.com/@uniswap/v2-core@1.0.0/build/IUniswapV2Factory.json"
      }}>{`https://unpkg.com/@uniswap/v2-core@1.0.0/build/IUniswapV2Factory.json`}</a></p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
